/* eslint-disable jsx-a11y/no-noninteractive-element-interactions */
/* eslint-disable jsx-a11y/click-events-have-key-events */
import React, { useState } from 'react';

const Applicants = () => {
  const applicantsSectionEnum = {
    SEARCH: 'SEARCH',
    TO_REVIEW: 'TO_REVIEW',
    FRIEND_PASS: 'FRIEND_PASS',
    ACCEPTED_PUSH_TO_RELEASE: 'ACCEPTED_PUSH_TO_RELEASE',
    GIA: 'GIA',
    WAITLISTED_PUSH_TO_RELEASE: 'WAITLISTED_PUSH_TO_RELEASE',
    ACCEPTED_ON_APP: 'ACCEPTED_ON_APP',
    WAITLISTED: 'WAITLISTED',
    BANNED: 'BANNED',
  };

  const [applicantsSection, setApplicantsSection] = useState(applicantsSectionEnum.TO_REVIEW);

  const applicantsSectionOnClickHandler = () => {
    setApplicantsSection(applicantsSectionEnum.TO_REVIEW);
    console.log('clicked');
  };

  return (
    <div>
      <div className="tabs is-boxed">
        <ul>
          <li
            onClick={(e) => applicantsSectionOnClickHandler(e)}
            className={`${applicantsSection === applicantsSectionEnum.SEARCH || ''}`}
          >
            <a>
              Search
            </a>
          </li>
          <li>To Review</li>
          <li>Friend Pass</li>
          <li>Accepted: Push to Release</li>
          <li>GIA</li>
          <li>Waitlisted: Push to Release</li>
          <li>Accepted: On App</li>
          <li>Waitlisted</li>
          <li>Banned</li>
        </ul>
      </div>
    </div>
  );
};

export default Applicants;
